import ReactDOM from "react-dom/client";

import "./index.css";
import Routerdom from "./Routerdom";
import UseRaduce from "./UseRaduce";
const root = ReactDOM.createRoot(document.getElementById("root"));

root.render(
  <React.StrictMode>
    <UseRaduce/>
    <Routerdom/>
  </React.StrictMode>
);
